@DUA_LAPEEP @dlipanews @DUALIPA @DaBabyDaBaby The Mediabase chart entry accounts for all versions, so there's no difference in this case.

We always reference DaBaby in our Tweets, since we've seen radio stations confirm they're playing that one.

But, technically, DaBaby has never received credit on the Mediabase chart.

@stella101s @DUALIPA @DaBabyDaBaby However, Levitating received a (very rare) second wind, and has been posting major airplay gains over the past few weeks.

It is now the fifth-most-played song at pop radio.

But Mediabase has not yet decided to override its recurrent status and bring it back to the chart.

