@joonie1996 @meoriepurrisosa @TXT_members @TXT_bighit The video is connected to the Ellen site; they keep track of performance, run ads on the video, etc. So it counts in that sense.

It does not count toward the traditional TV rating.

But by sending these videos out each night, "Ellen" makes it clear that they value these views.

@TXT_members @TXT_bighit To answer some questions:

1) This is an official/authorized release. "Ellen" sends select media outlets some videos prior to each day's episode.

2) There will obviously be a ton of traffic, so we apologize in advance of the site starts to move slowly.

